class DataHandle(object):
    def dataHandle(self,item,let_balls,dics,minute):
        # 清洗数据 dics 有8个数组
        # 1 射正球门  2 射偏球门  3 危险进攻  4 进攻
        # 6 分钟处理
        current_minite_data =[]
        self.handle_letBall(let_balls)
        home_zheng = self.find_current_data(dics[0], minute)
        away_zheng = self.find_current_data(dics[1], minute)
        home_pian = self.find_current_data(dics[2], minute)
        away_pian = self.find_current_data(dics[3], minute)
        home_risk = self.find_current_data(dics[4], minute)
        away_risk = self.find_current_data(dics[5], minute)
        home_attack = self.find_current_data(dics[6], minute)
        away_attack = self.find_current_data(dics[7], minute)
        #危攻比
        risk_rate = round(self.zero_to_half(home_risk) /self.zero_to_half(away_risk), 2)
        #攻比
        attack_rate = round(self.zero_to_half(home_attack) / self.zero_to_half(away_attack), 2)
        #主客总
        home_total = home_zheng + home_pian
        away_total = away_zheng + away_pian
        #射差
        total_cha = home_total - away_total
        #射比
        total_attack_rate = round(self.zero_to_half(home_total) / self.zero_to_half(away_total), 2)
        '''
        letBall["match_time"]
        letBall["score"]
        letBall["home_team"]
        letBall["let_ball"]
        letBall["away_team"]
        letBall["time"]
        '''
        #主客计算[{}]
        #6分钟净胜球
        #全场净胜球
        global_gd = item["goalDifference"]
        current_gd,current_pankou,current_home_odds,current_away_odds,current_gun_rate = self.find_current_letballs(let_balls, minute)
        current_home = round(self.zhu_calculate(global_gd,current_pankou,current_gd,current_home_odds),2)
        current_away = round(self.ke_calculate(global_gd,current_pankou,current_gd,current_away_odds),2)

        current_minite_data.extend([current_gun_rate,
                                    current_gd,
                                    current_pankou,
                                    home_risk,
                                    away_risk,
                                    risk_rate,
                                    home_attack,
                                    away_attack,
                                    attack_rate,
                                    home_zheng,
                                    away_zheng,
                                    home_total,
                                    away_total,
                                    total_cha,
                                    total_attack_rate,
                                    current_home,
                                    current_away])
        return current_minite_data

        #   6滚比 6主 6客 6盘口
    #处理让球数据[{}]
    def handle_letBall(self,data):
        #1.处理分数——>净胜分
        #2.处理让球——>盘口
        for item in data:
            rate_score = item["score"]
            if rate_score=="-":
                continue
            home_score = float(rate_score.split(":")[0])
            away_score = float(rate_score.split(":")[1])
            item["current_gd"] = home_score-away_score
            let_ball = item["let_ball"]
            if let_ball == "-":
                let_ball = 0.0
            else:
                let_ball = let_ball.split(",")
                if(len(let_ball)==2):
                    let_ball = (float(let_ball[0])+float(let_ball[1]))/2
                else:
                    let_ball = float(let_ball[0])
            item["current_pankou"] = float(let_ball)
        return data


    #处理现场数据

    def find_current_data(self,datas, current_time):
        # 如果有这个时刻的数据，直接查找
        # 没有的话找到这个时间的前一个时刻
        if current_time=='半':
            current_time =45
        #  1 有这个时间段的数据直接返回
        #  2 没有找到比他时间大的前一个值
        #  3 他比最后一个还要大直接返回最后一个
        current_data = datas.get(str(current_time))
        if current_data is None:
            keys = list(datas.keys())
            values = list(datas.values())
            if current_time > int(keys[len(keys) - 1]):  # 比最后一个大
                current_data = values[len(values) - 1]
            else:
                for i in keys:
                    if (int(i) > int(current_time)):
                         # 查找前一时间段的数据
                        current_data = values[keys.index(i) - 1]
                        break
        else:
            current_data = int(datas.get(str(current_time)))
        return int(current_data)
    # 查找当前时间让球赔率
    def find_current_letballs(self,letballs,minute):
        minute_date = []
        # 找到当前时间的数据集
        for item in letballs:
            if item["match_time"] == str(minute):
                minute_date.append(item)
        #处理数据
        len_minute_data =len(minute_date)

        if len_minute_data==0:
            return self.find_current_letballs(letballs,minute-1)
        else:
            index = len_minute_data-1
            current_gd = minute_date[index]["current_gd"]
            current_pankou = minute_date[index]["current_pankou"]
            current_home_odds = minute_date[index]["home_team"]
            current_away_odds = minute_date[index]["away_team"]
            current_gun_rate = minute_date[index]["score"].replace(":","::")
            return current_gd,current_pankou,current_home_odds,current_away_odds,current_gun_rate
#把数据0处理成0.5
    def zero_to_half(self,a):
        if a == 0:
            return 0.5
        else:
            return float(a)

    def zhu_calculate(self,m,q,x,stage):
        '''
        M 代表全场净胜球  Q 当前盘口  x当前净胜球
        6主:
        M+Q-当前比分差X(比分状态的差)   <=-0.5    AD=-1
        M+Q-当前比分差X(比分状态的差)   ==-0.25   AD=-0.5
        M+Q-当前比分差X(比分状态的差)   ==0      AD=0
        M+Q-当前比分差X(比分状态的差)   ==0.25   AD=(左侧水位-1)/2
        M+Q-当前比分差X(比分状态的差)   >=0.5    AD=左侧水位-1

        6客
        M+Q-当前比分差X(比分状态的差)   <=-0.5    AE=右侧水位-1
        M+Q-当前比分差X(比分状态的差)   ==-0.25   AE=(右侧水位-1)/2
        M+Q-当前比分差X(比分状态的差)   ==0      AE=0
        M+Q-当前比分差X(比分状态的差)   ==0.25   AE=-0.5
        M+Q-当前比分差X(比分状态的差)   >=0.5    AE=-1
        '''
        sum = m+q-x
        if sum <= -0.5:
            return -1
        if sum == -0.25:
            return -0.5
        if sum == 0:
            return  0
        if sum == 0.25:
            return float((stage-1))/2
        if sum >= 0.5:
            return stage-1

    def ke_calculate(self,m,q,x,stage):
        sum = m+q-x
        if sum <= -0.5:
            return stage-1
        if sum == -0.25:
            return float((stage-1))/2
        if sum == 0:
            return 0
        if sum == 0.25:
            return -0.5
        if sum >= 0.5:
            return -1
